import React, { useState, useEffect } from "react";
import { getHistory } from "../services/api";

const SearchHistory = () => {
  const [history, setHistory] = useState([]);

  useEffect(() => {
    fetchHistory();
  }, []);

  const fetchHistory = async () => {
    const data = await getHistory();
    setHistory(data);
  };

  return (
    <div className="p-8 bg-gray-100 h-screen overflow-auto">
      <h2 className="text-2xl font-bold mb-4">Historial de BÃºsquedas</h2>
      <table className="min-w-full bg-white border border-gray-300">
        <thead>
          <tr>
            <th className="py-2 px-4">Fecha</th>
            <th className="py-2 px-4">Cat Fact</th>
            <th className="py-2 px-4">Query</th>
            <th className="py-2 px-4">GIF</th>
          </tr>
        </thead>
        <tbody>
          {history.map((item) => (
            <tr key={item.id} className="border-b border-gray-200">
              <td className="py-2 px-4">{new Date(item.searchDate).toLocaleString()}</td>
              <td className="py-2 px-4">{item.catFact}</td>
              <td className="py-2 px-4">{item.query}</td>
              <td className="py-2 px-4">
                {item.gifUrl ? (
                  <img src={item.gifUrl} alt="GIF" className="w-16 h-16 rounded" />
                ) : (
                  "No disponible"
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default SearchHistory;
